import React from 'react';
import './Navbar.css';

const Navbar = () => {
    return (
        <body>
            <nav className = "navbar">
                <div className = "navbar-left">
                <ul className = "nav-links">
                    <li>
                        <Link to="/">Home</Link>     
                    </li>
                    <li>
                        <Link to="/projects">My Code</Link>
                    </li>
                    <li>
                        <Link to="/photography">My Lens</Link>
                    </li>
                    <li>
                        <Link to="/resume">My Resume</Link>
                    </li>   
                </ul>
                </div>
            </nav>
        </body>
    );
};

export default Navbar;
